import React from "react";
import styled from "styled-components";

const Wrapper = styled.div`
  width: 100%;
  height: 64px;
  border-bottom: solid 1px #dbdbdb;
`;
function Header() {
  return (
    <Wrapper>
      <img src="/assets/logo.svg" alt="Aju" />
    </Wrapper>
  );
}

export default Header;
